%% Cutting BHZ Disk into Different Geometries
% This tutorial demonstrates how to create various geometric shapes (hexagon, triangle, 
% rectangle, rhombus) from a graphene tight-binding (TB) disk using the `cut_orb` method.

%[text] %[text:anchor:H_58D59B31] ## useful tool
useful_matrices({'sigma','tau'});
syms C0 C1 C2 real;
syms M0 M1 M2 real;
syms A0 A1 A2 B real;
syms k_x k_y k_z real;
%[text] %[text:anchor:H_55D18AB7] ### Model
M       = -M0+M2*(k_x^2+k_y^2)+M1*(k_z^2);
E0k     = C0+C2*(k_x^2+k_y^2)+C1*(k_z^2);
A       = A0+A2*(k_x^2+k_y^2)+A1*(k_z^2);
k_plus  = k_x + 1i* k_y;
k_minus = k_x - 1i* k_y;
%
BHZ = HK(4,3);
% 4: orbital number  dimension of mat
% 3: To k^3
%
BHZ = BHZ ...
    +Term(A*k_x ,sigma_z*tau_x )...
    +Term(A*k_y ,sigma_0*tau_y )...
    +Term(E0k   ,sigma_0*tau_0 )...
    +Term(M     ,sigma_0*tau_z )...
    +Term(B*k_z*(k_x^2-k_y^2),sigma_x*tau_x )...
    +Term(2*B*k_z*(k_x*k_y),sigma_y*tau_x )...
    ;
C0     = 0;
A1     =  0    ;
A2     =  0    ;
BHZ = BHZ.Subsall('sym');
%[text] %[text:anchor:H_1E7E0A9E] ### PARA
% unit eV 
M0     = -1   ;
%M0     = -0.25   ;
% unit eV Ang
A0      =  1      ;
%B      =  4.1      ;
% unit eV Ang^2
C1     =  0     ;
C2     =  0     ;
M1     =  -0.5      ;
M2     =  -0.5  ;
B     =  1   ;
% unit    Ang
a      =  1        ;
b      =  1       ;
c      =  1        ;
BHZ = BHZ <'POSCAR_6';
BHZ_TB = BHZ.kp2TB();
BHZ_TB_n = BHZ_TB.Subsall();
%%
%[text] %[text:anchor:H_36D53B26] ## Nanodisk
Nslab = [20 20 1];
BHZ_TB_disk = BHZ_TB_n.Hnanowire_gen(Nslab);
BHZ_TB_disk.show('NRPTS','vectorList',[0,0,0],'scale',3);
view(0,90);
%%

% Generate figure with 2x2 subplots for visualization
[Fig, Ax] = Figs(2, 2);
set(Fig,"Position",[0 0 16 9]*500);
% 1. Hexagon Cutting
Nsuper = 20;            % Supercell size parameter
efsmall = 1e-6;         % Epsilon for numerical stability

% Define removal function for hexagonal boundaries
rmfunc_hex = @(i1, i2, i3) ...
    i1 > 1 - 1/Nsuper + efsmall | ...        % Right boundary
    i2 > 1 - 1/Nsuper + efsmall | ...        % Top boundary
    i2 - i1 > 0.5 - 1/Nsuper + efsmall | ...% Upper diagonal cut
    i2 - i1 < -0.5 + 1/Nsuper - efsmall;    % Lower diagonal cut

% Create and visualize hexagonal structure
BHZ_TB_disk_hex = BHZ_TB_disk.cut_orb('rmfunc', rmfunc_hex);
BHZ_TB_disk_hex.show('NRPTS', 'vectorList', [0,0,0], 'scale', 5, 'ax', Ax(1));
title(Ax(1), 'Hexagon');
axis(Ax(1), 'equal');

% 2. Triangle Cutting
Nsuper = 30;            % Larger supercell for finer resolution
efsmall = 1e-6;

% Define removal function for triangular boundaries
rmfunc_tri = @(i1, i2, i3) i2 - i1 > 0.0 - 1/Nsuper + efsmall;

% Create and visualize triangular structure
BHZ_TB_disk_tri = BHZ_TB_disk.cut_orb('rmfunc', rmfunc_tri);
BHZ_TB_disk_tri.show('NRPTS', 'vectorList', [0,0,0], 'scale', 5, 'ax', Ax(2));
title(Ax(2), 'Triangle');
axis(Ax(2), 'equal');

% 3. Rectangle Cutting
Nsuper = 20;
efsmall = 1e-6;

% Define removal function for rectangular boundaries
rmfunc_rec = @(i1, i2, i3) ...
    i2 > 1 - 1/Nsuper + efsmall | ...       % Top boundary
    i2 - 2*i1 > 0 + efsmall | ...           % Right diagonal cut
    i2 - 2*i1 < -1 + 1/Nsuper - efsmall;    % Left diagonal cut

% Create and visualize rectangular structure
BHZ_TB_disk_rec = BHZ_TB_disk.cut_orb('rmfunc', rmfunc_rec);
BHZ_TB_disk_rec.show('NRPTS', 'vectorList', [0,0,0], 'scale', 5, 'ax', Ax(3));
title(Ax(3), 'Rectangle');
axis(Ax(3), 'equal');

% 4. Rhombus Cutting
Nsuper = 20;
efsmall = 1e-6;

% Define removal function for rhombus boundaries
rmfunc_rho = @(i1, i2, i3) ...
    i2 - i1 < 0.0 - 1/Nsuper + efsmall | ...% Lower diagonal cut
    i2 - i1 > 0.5 - 1/Nsuper + efsmall | ...% Upper diagonal cut
    i1 > 0.5 + efsmall;                     % Right boundary

% Create and visualize rhombus structure
BHZ_TB_disk_rho = BHZ_TB_disk.cut_orb('rmfunc', rmfunc_rho);
BHZ_TB_disk_rho.show('NRPTS', 'vectorList', [0,0,0], 'scale', 5, 'ax', Ax(4));
title(Ax(4), 'Rhombus');
view(Ax(4), 0, 90);    % Adjust view for better visualization
axis(Ax(4), 'equal');


% Advanced Tip: Using uicut
% For more advanced cutting features, explore the `uicut` function which provides:
% - Interactive boundary selection
% - Multi-step cutting operations
% - Visual feedback during cutting

%%
%[text] ## **Fractal**
Nslab = [60 60 1];
BHZ_TB_disk = BHZ_TB_n.Hnanowire_gen(Nslab); %[output:8f7c332b]
%%
figure(); %[output:4f5a8195]
BHZ_TB_disk.Rm %[output:689f5950]
orginRm = [0.5,0.5,0]*BHZ_TB_disk.Rm %[output:4553ce66]
norm(orginRm) %[output:9c2f7961]
[pgon, vertices] = generateKochSnowflake(4,-pi/3,orginRm([1,2]),norm(orginRm)/2);
plot(pgon); %[output:4f5a8195]
BHZ_TB_disk_Snowflake = uicut(BHZ_TB_disk,[0,0,0],'pgon',pgon,'no_ui',true,'POSCARgen',0); %[output:3b272e5f]
BHZ_TB_disk_Snowflake.show('NRPTS','TwoD',1,'vectorList', [0,0,0], 'scale', 1);view(gca,0,90) %[output:85efb20e]
%%
figure(); %[output:2754c20e]
BHZ_TB_disk.Rm %[output:3f0985bf]
orginRm = [0.5,0.5,0]*BHZ_TB_disk.Rm %[output:1f481987]
norm(orginRm) %[output:23b0f103]
bias = [0.3,0] %[output:6fba0a05]
[pgon, vertices] = generateSierpinskiTriangle(2,-pi/3,orginRm([1,2])-bias,norm(orginRm)/2+bias(1));
plot(pgon); %[output:2754c20e]
BHZ_TB_disk_fractal = uicut(BHZ_TB_disk,[0,0,0],'pgon',pgon,'no_ui',true,'POSCARgen',0); %[output:15179d56]
BHZ_TB_disk_fractal.show('NRPTS','TwoD',1,'vectorList', [0,0,0], 'scale', 1);view(gca,0,90) %[output:768905c8]

